function Test() {
    const [count, setCount] = useState(5);
    const increment = () => setCount(count + 1);
    const name = "Carl";
    return({count, increment, name})
}

function Tree() {
    const Manage = event => {return(event.target.value)}
    return(
        <div>
            <input type="text" onChange={Manage} value={Manage}/>
        </div>
    )
}

export default function Count() {

    return (
        <div>
            <Tree />
            <button >{Manage}</button>
        </div>
    )
}
